M::usage="

M[Subindex,LimitingCase][LoopOrder,AplhaTOrder] calculates the MSSM pole mass expansion in the DR scheme.
This functions expresses the mass expansion in terms of:

k,mt,at,a3, e.g.

Mh^2 = MZ^2 Cos[2 beta]^2 
+ mt^2 ( at(k^(1/2)Deltamh2_at + k a3 Deltamh2_atas + k^(3/2) a3^2 Deltamh2_atas2 + ... ) +  at^2(k Deltamh2_at2 + ... )).

It can take 2 subindices: 

't', and
'h'.

Available limiting cases are: 

'GeneralSolution', which returns the general mass expansion with symbolic threshold corrections,
'Degenerate', which sets every soft-SUSY mass parameter equal to MS and Xt & Tan[beta] are left free,
'NonDegenerate', which is the complete solution.

The mass expansion contains the following soft-SUSY parameters: 

mu, mA, m3, mQ3, mU3, msq, Xt, Yt and beta,

and in the 'GeneralSolution' case the DR threshold corrections, 'Dxat(n)as(m)', appear.

The Higgs boson DR mass expansion (subindex 'h') can be calculated up to O(mt^2 at a3^3) X O(Log[MR^2/mt^2]^(n-2)), and partial O(mt^2 at^2 a3) & O(mt^2 at^3).
alphatOrder is set to 1 by defualt and can be ommited if no higher powers are desired to be computed.

";

(*
'CompletelyDegenerate', which sets every soft-SUSY mass parameter equal to MR and Xt & Tan[beta] are left free, and
'Harlander', which is similar to the degenerate limit but leaves the squark masses free, and sets Xt=0.
'Custom', where one can choose the desired value of the SUSY parameters by evaluating the following association rule:

Custom=<|
'mu'->mu,
'mA'->mA,
'm3'->m3,
'mQ3'->mQ3,
'mU3'->mU3,
'msq'->msq,
'Xt'->Xt,
'MR'->MR
|>,

but using quotation marks instead of apostrophes in the lhs of the rule, and the desired value of the parameter on the rhs.
Note: certain values of the parameters render the threshold corrections unstable and lead to divergent results in this program.
*)

Mx::usage="

Mx[Subindex,LimitingCase,Scheme][LoopOrder,AplhaTOrder] calculates the MSSM pole mass expansion in the DR scheme.
This functions expresses the mass expansion in terms of:

k,vu,yt,g3, e.g.

Mh^2 = MZ^2 Cos[2 beta]^2 
+ yt^2 vu^2( yt^2 Sin[beta]^2(k Deltamh2_at + k^2 g3^2 Deltamh2_atas + k^3 g3^4 Deltamh2_atas2 + ... ) +  yt^4 Sin[beta]^4(k^2 Deltamh2_at2 + ... )).
 
It can take 2 subindices: 

't', and
'h'.

Available limiting cases are: 

'FromDRToMS', which converts the DR expansion back to MS and must agree with the original MS expansion. Must be used with 'DR' scheme (see below).
'GeneralSolution', which returns the general mass expansion with symbolic threshold corrections,
'Degenerate', which sets every soft-SUSY mass parameter equal to MS and Xt & Tan[beta] are left free,
'NonDegenerate', which is the complete solution.

The mass expansion contains the following soft-SUSY parameters: 

mu, mA, m3, mQ3, mU3, msq, Xt, Yt and beta,

and in the 'GeneralSolution' case the MS threshold corrections, 'dxat(n)as(m)', appear even when the expansion is in the DR scheme.

Available schemes are:

'SM', returns the SM mass expansion in the MS scheme,
'MS', returns the MSSM mass expansion in the MS scheme,
'DR', returns the MSSM mass expansion in the DR Scheme.

The Higgs boson DR mass expansion (subindex 'h') can be calculated up to O(mt^2 at a3^3) X O(Log[MR^2/mt^2]^(n-2)), and partial O(mt^2 at^2 a3) & O(mt^2 at^3).
alphatOrder is set to 1 by defualt and can be ommited if no higher powers are desired to be computed.

All other functions in this program that compute Higgs mass expansions are based on this function.

";

Mh2::usage="

Mh2[_] is a variable containing the complete pre-loaded 3-loop order MSSM DR Higgs boson mass expansionof the form, e.g.

Mh^2 = MZ^2 Cos[2 beta]^2 
+ mt^2 ( at(k^(1/2)Deltamh2_at + k a3 Deltamh2_atas + k^(3/2) a3^2 Deltamh2_atas2 + ... ) +  at^2(k Deltamh2_at2 + ... )).

The blank, _ , can be filled with:

'EFT', which contains the mass expasion expressed in terms of mt,at,a3 and, as an expansion computed using the EFT, this expansion is organized in powers of Log[MR^2/mt^2] as follows:
This expansion is organized as follows:

{Log[MR^2/mt^2],0,3},\[IndentingNewLine]{Log[m3^2/MR^2],0,3},\[IndentingNewLine]{Log[mQ3^2/MR^2],0,3},\[IndentingNewLine]{Log[mU3^2/MR^2],0,3},\[IndentingNewLine]{Log[msq^2/MR^2],0,3},\[IndentingNewLine]{PolyLog[2,1-m3^2/mQ3^2],0,2},\[IndentingNewLine]{PolyLog[2,1-m3^2/mU3^2],0,2},\[IndentingNewLine]{PolyLog[2,1-mU3^2/mQ3^2],0,2},\[IndentingNewLine]{PolyLog[2,1-msq^2/m3^2],0,2},\[IndentingNewLine]{PolyLog[2,1-msq^2/mQ3^2],0,2},\[IndentingNewLine]{PolyLog[2,1-msq^2/mU3^2],0,2},\[IndentingNewLine]{Xt,0,8},

and the coefficient of these variables is a rational function of the Soft-SUSY parameters.

'DR', which contains the mass expansion expressed in terms of vu,yt,g3 and, as a proper expansion of a high scale theory in the DR scheme, this expansion is organized in powers of Log[MR^2/mQ3^2] as follows:

{Log[MR^2/mQ3^2],0,3},\[IndentingNewLine]{Log[mt^2/mQ3^2],0,3},\[IndentingNewLine]{Log[m3^2/mQ3^2],0,3},\[IndentingNewLine]{Log[mU3^2/mQ3^2],0,3},\[IndentingNewLine]{Log[msq^2/mQ3^2],0,3},\[IndentingNewLine]{PolyLog[2,1-m3^2/mQ3^2],0,2},\[IndentingNewLine]{PolyLog[2,1-m3^2/mU3^2],0,2},\[IndentingNewLine]{PolyLog[2,1-mU3^2/mQ3^2],0,2},\[IndentingNewLine]{PolyLog[2,1-msq^2/m3^2],0,2},\[IndentingNewLine]{PolyLog[2,1-msq^2/mQ3^2],0,2},\[IndentingNewLine]{PolyLog[2,1-msq^2/mU3^2],0,2},\[IndentingNewLine]{Xt,0,8},

and the coefficient of these variables is a rational function of the Soft-SUSY parameters.

'DRratios', which contains the mass expansion expressed in terms of vu,yt,g3 and in powers of Log[MR^2/mQ3^2], just like 'DR' but the masses have been replaced by dimensionless parameters:

xEWS=mt/mQ3, stands as the ratio between the EW and the SUSY scales. At the order considered in this program, O((v^2/MS^2)^0), only appears as the argument of Log functions,
x12=mU3/mQ3,
x32=m3/mQ3,
xsq2=msq/mQ3,
xt=Xt/mQ3.

This expansion is particularly suitable for obtaing limiting cases by performing series expansions in {-1+x32^2), (-1+x12^2), and (-1+xsq2^2).

Soft-SUSY parameters:

m3, mQ3, mU3, msq, Xt and beta.

";

dMh2dMR::usage="

dMh2dMR[n] calculates the total derivative of the Higgs boson squared pole mass expansion with respect to MR^2.

It returns

(vu^2 yt^4 Sin[beta]^2)^-1 MR^2 (d/d(MR^2))Mx[h,NonDegenerate][n,1].

";

deltamh2::usage="

deltamh2[Alpha3Order,LogOrder] returns the loop correction of the Higgs boson DR mass at the desired order of alpha_t and alpha_3, and power of Log[MR^2/mt^2].
alphatOrder is set to 1 by defualt and can be ommited if no higher powers are desired to be computed.

This function extracts the coefficients from the already pre-loaded complete 3-loop order Higgs mass expansion stored in the symbol 'Mh2[EFT]'.

";

LogCoefficient::usage="

LogCoefficient is a function that can receive two types of input, namely, [Alpha3Order,LogOrder,m3LogOrder,mQ3LogOrder,mU3LogOrder,msqLogOrder] and [Alpha3Order,LogOrder,SUSYMass,SUSYMassLogOrder].
This functions is mainly intended to study the terms of O(Log[MR^2/mt^2]^0), which contain a big structure in SUSY logarithms.

Using the first type of input, it returns the term of the explicitly specified powers of the different types of logarithmic terms. This type of input is ableto return the purely non-logarithmic terms at each order by setting every power of the SUSY dependent logarithm to zero.
With the first input, however, it is not able to return e.g. the complete 3-loop order term of O(Log[MR^2/mt^2] Log[m3^2/MR^2]) at a time, since it includes various types of logarithms.
Using the second type of input, it returns the complete logarithmic term of the desired SUSY mass at the desired power. The possible SUSY masses are m3, mQ3, mU3, msq.

This function extracts the coefficients from the already pre-loaded complete 3-loop order Higgs mass expansion stored in the symbol 'Mh2[EFT]'.

";

K::usage="

K{Subindex}[n,p] returns the SM MS coefficient of Log[MR^2 MSyt^-2 MSv^-2] at all possible O(alpha_t^n alpha_3^m) at each loop order.

";

BetaFunction::usage="

BetaFunction[g,n] returns the beta function of the SM MS parameters.

The first argument gives the parameter in the following order: {MSg3,MSyt,MSlambda,MSv}, and the second argument the loop order, where order 0 is the parameter itself.

";

MSSMBetaFunction::usage="

MSSMBetaFunction[g,n] returns the beta function of the SM MS parameters.

The first argument gives the parameter in the following order: {g3(MR),yt(MR),m3(MR),mU3(MR),mQ3(MR),Xt(MR)}, and the second argument the loop order, where order 0 is the parameter itself.

";

ListOfParameters::usage="

Returns the list of relevant parameters in the mass expansions.

";



