(*
3-loop order beta-functions taken from [Mihaila et al., 2012, arXiv:1201.5868], [Mihaila et al., 2012, arXiv:1208.3357], [Bednyakov et al., 2013, arXiv:1212.6829], and [Bednyakov et al., 2013, arXiv:1303.4364].
4-loop order lambda beta-function taken from [Martin, 2015, arXiv:1508.00912v1].
*)

BetaFunctions={

{
MSg3,
k(-7 MSg3^3),
k^2(-26 MSg3^5-2 MSg3^3 MSyt^2),
k^3((65 MSg3^7)/2-40 MSg3^5 MSyt^2+15 MSg3^3 MSyt^4),
k^4 betag34Loop (MSg3^9+MSg3^7 MSyt^2+MSg3^5 MSyt^4+MSg3^3 MSyt^6)
},

{
MSyt,
k(-8 MSg3^2 MSyt+(9 MSyt^3)/2),
k^2(-12 MSyt^5+MSyt^3 (36 MSg3^2-3 MSlambda)+MSyt (-108 MSg3^4+(3 MSlambda^2)/8)),
k^3((MSyt^5 (-3255552 MSg3^2+1026432 MSlambda))/20736+(MSyt^7 (878688+279936 Zeta[3]))/20736+(MSyt^3 (13226112 MSg3^4+82944 MSg3^2 MSlambda+4860 MSlambda^2-4727808 MSg3^4 Zeta[3]))/20736+(MSyt (-28795392 MSg3^6-11664 MSlambda^3+13271040 MSg3^6 Zeta[3]))/20736),
k^4 betayt4Loop (MSg3^8 MSyt +MSg3^6 MSyt^3 +MSg3^4 MSyt^5 +MSg3^2 MSyt^7)
},

{
