k^2(1/24 (-3072 MSg3^2 MSyt^4+2880 MSyt^6)+1/24 (1920 MSg3^2 MSyt^2-72 MSyt^4) MSlambda-36 MSyt^2 MSlambda^2-(39 MSlambda^3)/2),
k^3(873/8 MSyt^2 MSlambda^3+3/8 MSlambda^4 (299+168 Zeta[3])+1/16 MSlambda^2 (-9792 MSg3^2 MSyt^2+6876 MSyt^4+9216 MSg3^2 MSyt^2 Zeta[3]+6048 MSyt^4 Zeta[3])+8 (-38 MSg3^2 MSyt^6-(1599 MSyt^8)/8+240 MSg3^2 MSyt^6 Zeta[3]-36 MSyt^8 Zeta[3]+(MSyt^4 (-306432 MSg3^4+110592 MSg3^4 Zeta[3]))/3456)+8 MSlambda ((117 MSyt^6)/32-99/2 MSyt^6 Zeta[3]+1/4 (895 MSg3^2 MSyt^4-1296 MSg3^2 MSyt^4 Zeta[3]+(MSyt^2 (716544 MSg3^4-82944 MSg3^4 Zeta[3]))/1728))),
k^4 ((8/27 MSg3^6 MSyt^4 (13097+3888 Inactive[Zeta][2]^2+44568 Zeta[3]-47400 Zeta[5]))+betalabda4Loop(MSg3^4 MSyt^6 + MSg3^2 MSyt^8 + MSyt^10))
},

