(* ::Subchapter::Closed:: *)
(*Function of the beta-functions*)


(*

The convention used here for the beta-functions is defined as follows:

beta_g_i({g_j}) = k beta_g_i^(1)({g_j}) + k^2 beta_g_i^(2)({g_j}) + k^3 beta_g_i^(3)({g_j}) + ... , where k=1/(4 Pi)^2

*)

(* 
The first argument gives the parameter in the following order: {MSg3(MR),MSyt(MR),MSlambda(MR),MSv(MR)}, and the second argument the loop order, where order 0 is the parameter itself 
*)

BetaFunction[g_,n_]:=BetaFunctions[[g]][[n+1]]/(k^n);

(* 
The first argument gives the parameter in the following order: {g3(MR),yt(MR),m3(MR),mU3(MR),mQ3(MR),Xt(MR)}, and the second argument the loop order, where order 0 is the parameter itself 
*)

MSSMBetaFunction[g_,n_]:=MSSMBetaFunctions[[g]][[n+1]]/(k^n);



(* ::Chapter::RGBColor[0., 0., 1.]::Closed:: *)
(*Pole Mass in the SM*)


(* ::Subchapter::Closed:: *)
(*C[n,p] ,p>0 : Coefficients of the powers of logs*)


(*
Recursion relation of the logs' coefficients,
extended result from [Martin, 2007, arXiv:hep-ph/0701051v1] Eqs. (3.3) - (3.4).
*)

K[Subindex_][n_Integer,p_Integer]/;p<=0:=Print["Error: 0<p\[LessEqual]n"];

K[Subindex_][n_Integer,p_Integer]/;p>n:=Print["Error: 0<p\[LessEqual]n"];

K[Subindex_][n_Integer,p_Integer]/;p==n:=Normal@Series[

-(1/(2 n)) 
Sum[
BetaFunction[G,1] D[K[Subindex][n-1,n-1],BetaFunction[G,0]],
{G,1,4}
],

{MSv,0,2},
{MSlambda,0,4},
{MSyt,0,12},
{MSg3,0,10}

];

K[Subindex_][n_Integer,p_Integer]/;p>0:=Normal@Series[

(Sum[
(BetaFunction[4,i]/MSv+BetaFunction[2,i]/MSyt) K[Subindex][n-i,p],
{i,1,n-p}
]
-(1/(2 p)) 
Sum[
Sum[
BetaFunction[G,j] D[K[Subindex][n-j,p-1],BetaFunction[G,0]],
{j,1,n-p+1}
],
{G,1,4}
]),

{MSv,0,2},
{MSlambda,0,4},
{MSyt,0,12},
{MSg3,0,10}

];



(* ::Subchapter::Closed:: *)
(*C[n,0] : Loop constants*)


(*
C[0,0],C[1,0], C[2,0], C[3,0] coefficients extracted from the 1-,2-, and 3-loop SM square pole mass of the Higss boson in the MS scheme
*)

K[h][0,0]:=MSlambda MSv^2;
K[h][1,0]:=(2MSlambda MSyt^2 + SMConstlambda2 MSlambda^2)MSv^2;
K[h][2,0]:=SMConstat2 MSyt^6 MSv^2;
K[h][3,0]:=SMConstatas2 MSg3^4 MSyt^4 MSv^2+SMConstat2as MSg3^2 MSyt^6 MSv^2;
K[h][4,0]:=SMConstatas3 MSg3^6 MSyt^4 MSv^2;

(* Taken from [Martin, 2007,arXiv:hep-ph/0701051] Eq. (3.16) *)

SM1LoopConst=SMConstlambda2->( -(1/4)(9Bh+2BW+BZ+6/5));

(* Taken from [Degrassi et al., 2013, arXiv:1205.6497v2[hep-ph]] Eq. (20) *)

SM2LoopConst=SMConstat2->24(-1+Inactive[Zeta][2]);

(* Taken from [Martin, Robertson, 2014, arXiv:1407.4336v2[hep-ph]] Eq. (3.3) *)

SM3LoopConst={
SMConstatas2->(-(3776/9)-2048/3 Inactive[PolyLog][4,1/2]+320 Zeta[3]+(2816 Inactive[Zeta][2]^2)/15+256/9 Log[2]^2 (-Log[2]^2+6 Inactive[Zeta][2]))
(*
,
SMConstat2as->2764.365
*)
};



(*
C[0,0],C[1,0], C[2,0], C[3,0] coefficients extracted from the 1-,2-, and 3-loop SM square pole mass of the Higss boson in the MS scheme
*)

K[t][0,0]:=MSyt MSv;
K[t][1,0]:=(16/3)MSg3^2 MSyt MSv+SMTopConstat MSyt^2 MSyt MSv;
K[t][2,0]:=SMTopConstas2 MSg3^4 MSyt MSv+SMTopConstatas MSyt^2 MSg3^2 MSyt MSv+SMTopConstat2 MSyt^4 MSyt MSv;
K[t][3,0]:=SMTopConstas3 MSg3^6 MSyt MSv+SMTopConstatas2 MSyt^2 MSg3^4 MSyt MSv+SMTopConstat2as MSyt^4 MSg3^2 MSyt MSv+SMTopConstat3 MSyt^6 MSyt MSv;
K[t][4,0]:=0;

(* Taken from [Fleischer et al.,1999,arXiv:hep-ph/9803493v5] *)

SMTop2LoopConst=SMTopConstas2->(4/3)^2 (-(71/8)+30 Inactive[Zeta][2]+12 Zeta[3]-48 Inactive[Zeta][2] Log[2])+(4/3) (-(83/2)-12 Inactive[Zeta][2]+3 (1111/24-8 Inactive[Zeta][2]-6 Zeta[3]+24 Inactive[Zeta][2] Log[2]));



(* ::Subchapter::Closed:: *)
(*Mass expansion*)


(*
Expansion of the scale (in)-dependent Higgs boson mass in powers of Log[MR^2/MSmt^2] using SM MS parameters
*)

Mx[Subindex_,GeneralSolution,SM][LoopOrder_Integer,AlphaTOrder_Integer:1]:=Normal@Series[

Sum[
k^n Sum[
K[Subindex][n,i] Log[MR^2 MSyt^-2 MSv^-2]^i,
{i,0,n}
],
{n,0,LoopOrder}
],

{MSv,0,2},
{k,0,LoopOrder},
{MSlambda,0,2},
