(*
Expansion of the scale (in)-dependent Higgs boson mass in powers of Log[MR^2/MSmt^2] using SM MS parameters
*)

Mx[Subindex_,GeneralSolution,MS][LoopOrder_Integer,AlphaTOrder_Integer:1]:=Normal@Series[

Sum[
k^n Sum[
(K[Subindex][n,i] Log[MR^2 MSyt^-2 MSv^-2]^i/.LambdaMatchingMSImplicit),
{i,0,n}
],
{n,0,LoopOrder}
],

{MSv,0,2},
{MSyt,0,2(AlphaTOrder+1)},
{k,0,LoopOrder},
{MSg3,0,2(LoopOrder-AlphaTOrder)},
{Log[MR^2 MSyt^-2 MSv^-2],0,LoopOrder},
{SMTopConstas2,0,4}

];

(*
MS Degenerate limit
*)

Mx[Subindex_,Degenerate,MS][LoopOrder_Integer,AlphaTOrder_Integer:1]:=Normal@Series[

Mx[Subindex,GeneralSolution,MS][LoopOrder,AlphaTOrder]/.ExplicitizeCorrectionsDeg,

{MSv,0,2},
{MSyt,0,2(AlphaTOrder+1)},
{k,0,LoopOrder},
{MSg3,0,2(LoopOrder-AlphaTOrder)},
{Log[MR^2 MSyt^-2 MSv^-2],0,LoopOrder},
{Ndlat2,0,2},
{CscBeta,0,8},
{SinBeta,0,8},
{CosBeta,0,8},
{Log[MS^2 MR^-2],0,LoopOrder},
{Xt,0,10},
{Yt,0,10},
{Inactive[Zeta][2],0,4},
{SMTopConstas2,0,4}

];

(*
